INSERT INTO `premiun_nell_itens` (`id`, `item_name`, `item_price`, `item_desc`, `item_cont`, `item_cat_id`, `item_type`, `item_date`, `item__img`, `item__id`, `item__ef1`, `item__efv1`, `item__ef2`, `item__efv2`, `item__ef3`, `item__efv3`, `created_at`, `updated_at`) VALUES
	(1, 'Frango Assado', 20, 'Este item lhe dará um bônus</br>\nextra de 2000 PvM.</br>\n<font color=\'yellow\'>Tempo Ativo: 4 horas.</font></br>\n<font color=\'yellow\'>Efeito não acumulativo.</font>', 199, 0, 1, '0000-00-00 00:00:00.0000', 3314, 3314, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(2, 'Bau de Experiência', 20, 'Este item dobra a taxa de</br>\nexperiência ganha.</br>\n<font color=\'yellow\'>Tempo Ativo: 2 horas.</font></br>\n<font color=\'yellow\'>Efeito acumulativo.</font>', 177, 0, 1, '2020-06-01 21:20:04.8703', 4140, 4140, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(3, 'Pergaminho do Perdão', 400, 'Perdoa os pontos caóticicos</br>\nnegativo, Deixando eles positivo.</br>\n<font color=\'yellow\'>Obs: Para usar clique com o butão direito.</font></br>\n\n\n', 200, 0, 1, '0000-00-00 00:00:00.0000', 3343, 3343, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(4, 'Bolsa do Andarilho', 50, 'Possibilita a liberação de outras</br>\r\nabas do seu inventário.</br>\r\n<font color=\'yellow\'>Tempo Ativo: 30 dias.</font></br>\r\n<font color=\'yellow\'>Obs: Para usar clique com o butão direito.</font></br>', 192, 0, 1, '2020-06-01 21:21:50.4134', 3467, 3467, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(5, 'Pedra da Troca Maior', 100, 'Permite a mudança do nome</br>\npersonagem.</br>\n<font color=\'yellow\'>Obs: Usar junto com a pedra da troca menor.</font></br>', 194, 0, 1, '0000-00-00 00:00:00.0000', 774, 774, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(6, 'Pedra da Troca Menor', 100, 'Pedra da Troca MaiorPedra da Troca MaiorPermite a mudança do nome</br>\npersonagem.</br>\n<font color=\'yellow\'>Obs: Usar junto com a pedra da troca maior.</font></br>', 200, 0, 1, '0000-00-00 00:00:00.0000', 775, 775, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(7, 'Poção Divina(7dias)', 100, 'Poção que aumenta em abundância</br>\nseu ATK,ATK MG, HP/MP.</br>\n<font color=\'yellow\'>Obs: O aumento é tanto para PvP quanto para PvM.</font></br>\n<font color=\'yellow\'>Obs: Para usar clique com o butão direito.</font></br>', 189, 0, 1, '0000-00-00 00:00:00.0000', 3379, 3379, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(8, 'Poção Divina(15dias)', 180, 'Poção que aumenta em abundância</br>\nseu ATK,ATK MG, HP/MP.</br>\n<font color=\'yellow\'>Obs: O aumento é tanto para PvP quanto para PvM.</font></br>\n<font color=\'yellow\'>Obs: Para usar clique com o butão direito.</font></br>\n', 200, 0, 1, '0000-00-00 00:00:00.0000', 3379, 3380, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(9, 'Retorno de Habilidade', 25, 'Retorna 100 pontos de cada atributo</br>\n(FORÇA, INTELIGÊNCIA DESTREZA E CONSTITUIÇÃO).</br>\n<font color=\'yellow\'>Obs: O aumento é tanto para PvP quanto para PvM.</font></br>', 200, 0, 1, '0000-00-00 00:00:00.0000', 3336, 3336, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(10, 'Poção Mental(20horas)', 20, 'Ao utilizar você recerá um bônus extra</br>\nde aumento de  ATK e ATK MG.</br>\n<font color=\'yellow\'>Tempo Ativo: 20 dias.</font></br>\n<font color=\'yellow\'>Obs: Para usar clique com o butão direito.</font>', 197, 0, 1, '0000-00-00 00:00:00.0000', 3321, 3321, 0, 0, 0, 0, 0, 0, NULL, NULL),
	(11, 'Poção Vigor(20horas)', 20, 'Ao utilizar você recerá um bônus extra</br>\nde aumento de HP/MP.</br>\n<font color=\'yellow\'>Tempo Ativo: 20 dias.</font></br>\n<font color=\'yellow\'>Obs: Para usar clique com o butão direito.</font>', 193, 0, 1, '0000-00-00 00:00:00.0000', 3316, 3316, 0, 0, 0, 0, 0, 0, NULL, NULL),
